import React, { useState, useEffect } from "react";
import { Link, useParams } from "react-router-dom";
import LandPadInfo from "./LandPadInfo";
import axios from "axios";
const SingleLandpad = () => {
  const [singlePad, setSinglePad] = useState([]);
  const { id } = useParams();
  console.log(id);
  //   const fetchData = () => {

  //   };
  useEffect(() => {
    axios.get(`https://api.spacexdata.com/v4/landpads/${id}`).then((res) => {
      console.log(res.data);
      setSinglePad(res.data);
    });
  }, [id]);
  return (
    <div className="container my-5 text-start">
      <div className="container text-light" style={{ marginTop: "90px" }}>
        <h1>
          <small className="text-light">LandPads Deatil</small>
        </h1>
        <h4 class>
          First Fligh Date :<small className="text-muted">{singlePad.name}{singlePad.type}</small>
        </h4>
        <div className="row">
          <div className="col-sm-6">
            <p>Type : {singlePad.full_name}</p>
            {/* <p>Crew : {props.crew_capacity}</p> */}
            <p>Dray Mass :{singlePad.locality}kg</p>
            <p
              className={singlePad.status === "active" ? "text-success" : "text-danger"}
            >
              {singlePad.status}
            </p>
            <p>Return Payload Mass:  kg</p>
            <button type="button" className="btn btn-outline-light btn-md">
              wikipedia
            </button>
          </div>
          <div className="col-sm-6">
            <p className="h6">Heat sheild deatil</p>
            <p>Materail:{singlePad.region}</p>
            {/* <p>size : {props.size}m</p> */}
            {/* <p>Temprature:{props.temp_degree} degree</p> */}
            <p>Dev partner : {}</p>
            <div>
              <h6>Other Deatil:</h6>
              <p>Launch Payload Mass : {}</p>
              <p>
                P{singlePad.longitude}
              </p>
            </div>
          </div>
        </div>
        <div>
          {/* <p calssName="h7 text-start">{props.description}</p> */}
        </div>
      </div>
      {/* <LandPadInfo  */}
      {/* name = {singlePad.name} */}
      {/* type = { singlePad.type}
    //   full_name = { singlePad.full_name}
    //   locality = { singlePad.locality}
    //   status = { singlePad.status}
    //   region = { singlePad.region}
    //   latitude = { singlePad.latitude}
    //   longitude= { singlePad.longitude}
    //   landing_attempts= { singlePad.landing_attempts}
    //   landing_successes= { singlePad.landing_successes}
    //   details = { singlePad.details}
    //   wikipedia= { singlePad.wikipedia}
      // /> */}
    </div>
  );
};

export default SingleLandpad;
